import classes from './Header.module.css';
import { Input } from 'antd';
const { Search } = Input;

function Header(){
    const onSearch = (value) => {
        console.log(value, 'ad')
    }

    return (
        <div className={classes.header}>
            <form className={classes.form}>
                <label htmlFor='site-search'>
                    <input className={classes.input} placeholder='Search your favorite recipe' type='search' id='site-search'></input>
                    <button className={classes.button}>Search</button>
                </label>
            </form>
            <Search placeholder="input search text" enterButton="Search" size="large" loading  onSearch={onSearch}/>
        </div>
    );
}

export default Header;
